css:
.python-nosetests {
  width: 40em;
  height: 100%;
  font-size: 90%;
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  align-items: stretch;
  align-content: stretch;
}
.python-nosetests .resizable-panel-handle {
  flex: 0 0 10px;
  cursor: col-resize;
}
.python-nosetests .mainview {
  flex: 1 1 auto;
  height: 100%;
  flex-direction: column;
  display: flex;
}
.python-nosetests .mainview .header {
  color: #999999;
  flex: 0 0 auto;
}
.python-nosetests .mainview .bar {
  background-color: rgba(0, 0, 0, 0.1);
  flex: 0 0 7px;
  cursor: row-resize;
}
.python-nosetests .mainview.muted {
  opacity: 0.6;
}
.python-nosetests .listview {
  flex: 0.5;
  overflow: auto;
  color: #444444;
}
.python-nosetests .listview .badge {
  margin-left: 0.6em;
  font-weight: bold;
}
.python-nosetests .listview .active {
  background-color: rgba(0, 0, 0, 0.1);
  font-weight: bold;
}
.python-nosetests .listview ul ul span {
  padding-left: 1em;
}
.python-nosetests .errorview {
  flex: 0.5;
  overflow: auto;
}
.python-nosetests .errorview ul {
  list-style-type: none;
  padding: 0;
  margin: 0;
}
.python-nosetests .errorview li {
  border-top: 1px solid #999999;
  padding: 0.5em;
}
.python-nosetests .errorview li.mute {
  opacity: 0.4;
}
.python-nosetests .errorview .filename {
  color: #999999;
}
.python-nosetests .errorview .function {
  color: #999999;
}
.python-nosetests .errorview .function span {
  font-family: Menlo, Monaco, Consolas, "Courier New", monospace;
  color: #444444;
}
.python-nosetests .errorview .code {
  font-family: Menlo, Monaco, Consolas, "Courier New", monospace;
  margin-left: 1em;
  color: #444444;
  background: inherit;
  white-space: pre;
}
.python-nosetests .errorview .message {
  white-space: pre;
}
